import './styles.css'
import  logo  from '../../assets/imgs/logo.jpeg';
const Card_negocition = () =>{
return (
    <div className='card_negocition'>
        <div className='empresa'>
            <img src={logo} alt='empresa'/>
        </div>

        <div className='meta'>
            <h3>R$ 15.000</h3>
        </div>

        <div className='valor'>
            <h3>R$ 14.500</h3>
        </div>

        <div className='conversao'>
            
        </div>
        
    </div>
)

}

export default Card_negocition;
